import express from "express";

const app = express();
app.use(express.json());

export type ItemType =
  | "Héroes"
  | "Armas"
  | "Armaduras"
  | "Ítems"
  | "Habilidades especiales"
  | "Épicas";

export type HeroType =
  | "Guerrero Tanque"
  | "Guerrero Armas"
  | "Mago Fuego"
  | "Mago Hielo"
  | "Pícaro Veneno"
  | "Pícaro Machete"
  | "Chamán"
  | "Médico";

interface Item {
  id: number;
  userId: number;
  name: string;
  description: string;
  type: ItemType;
  heroType?: HeroType;
  isAvailable: boolean;
  imagen: string; // Base64
}

// Imagen de prueba en base64 (un cuadrado rojo PNG)
const sampleBase64Image =
  "data:image/jpeg;base64,";

const items: Item[] = [
  {
    id: 101,
    userId: 1,
    name: "Espada Épica",
    description: "Una espada legendaria",
    type: "Armas",
    isAvailable: true,
    imagen: sampleBase64Image,
  },
  {
    id: 102,
    userId: 1,
    name: "Escudo de Hierro",
    description: "Resistente y robusto",
    type: "Armaduras",
    isAvailable: true,
    imagen: sampleBase64Image,
  },
  {
    id: 103,
    userId: 2,
    name: "Mago de Fuego",
    description: "Entrenado en la magia elemental",
    type: "Héroes",
    heroType: "Mago Fuego",
    isAvailable: true,
    imagen: sampleBase64Image,
  },
];

// Obtener todos los items o por userId
app.get("/items", (req, res) => {
  const userId = Number(req.query["userId"]);

  if (userId) {
    const userItems = items.filter(i => i.userId === userId);
    return res.json(userItems);
  }

  return res.json(items);
});

// Obtener item por id
app.get("/items/:id", (req, res) => {
  const item = items.find(i => i.id === Number(req.params.id));
  if (!item) return res.status(404).json({ error: "Item not found" });
  return res.json(item);
});
app.patch("/items/:id/availability", (req, res) => {
  const id = Number(req.params.id);
  const { isAvailable } = req.body;

  const item = items.find(i => i.id === id);
  if (!item) return res.status(404).json({ error: "Item not found" });

  item.isAvailable = isAvailable;
  return res.json(item);
});
// PATCH para actualizar disponibilidad y/o dueño
app.patch("/items/:id", (req, res) => {
  const id = Number(req.params.id);
  const { isAvailable, userId } = req.body;

  const item = items.find(i => i.id === id);
  if (!item) return res.status(404).json({ error: "Item not found" });

  if (typeof isAvailable === "boolean") item.isAvailable = isAvailable;
  if (typeof userId === "number") item.userId = userId;

  return res.json(item);
});

const PORT = 3002;
app.listen(PORT, () => console.log(`Item server running on port ${PORT}`));
